// ContactPage.jsx
import React from "react";
import { Mail, Lock, Eye, EyeOff } from 'lucide-react';
import Input from '../common/Input';
import Button from '../common/Button';

export default function ContactPage() {
  return (
    <div style={{ fontFamily: "Arial, sans-serif", padding: "2rem", maxWidth: 600, margin: "auto" }}>
      <h2 style={{ textAlign: "center" }}>Επικοινωνήστε μαζί μας</h2>

      <form
        onSubmit={(e) => {
          e.preventDefault();
          alert("Το μήνυμα εστάλη!");
        }}
      >
        <label>
          Όνομα:<br />
          <input name="name" required style={{ width: "100%", padding: 8, marginBottom: 10 }} />
        </label><br />

        <label>
          Email:<br />
          <input type="email" name="email" required style={{ width: "100%", padding: 8, marginBottom: 10 }} />
        </label><br />

        <label>
          Μήνυμα:<br />
          <textarea name="message" rows={4} required style={{ width: "100%", padding: 8, marginBottom: 10 }} />
        </label><br />

        <button type="submit" style={{ padding: "10px 20px" }}>Αποστολή</button>
      </form>

      <h3 style={{ marginTop: 40 }}>Βρείτε μας</h3>
      <iframe
        title="map"
        src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3145.5407824995715!2d23.7348!3d37.9755!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x0%3A0x0!2zMzfCsDU4JzMxLjgiTiAyM3CsNDQnMDUuMyJF!5e0!3m2!1sel!2sgr!4v1234567890"
        width="100%"
        height="300"
        style={{ border: 0 }}
        allowFullScreen=""
        loading="lazy"
      />
    </div>
  );
}
